import Bat from './bat';
import BlackOrc from './black-orc';
import Cerberus from './cerberus';
import Dragon from './dragon';
import FireSpirit from './fire-spirit';
import FungiBulb from './fungi-bulb';
import GasCloud from './gas-cloud';
import Goblin from './goblin';
import Ghost from './ghost';
import Imp from './imp';
import Lich from './lich';
import LichKing from './lich-king';
import Medusa from './medusa';
import Orc from './orc';
import Plantera from './plantera';
import PoisonCloud from './poison-cloud';
import PumpkinGhost from './pumpkin-ghost';
import Rat from './rat';
import Salamander from './salamander';
import Snake from './snake';
import StoneGolem from './stone-golem';
import Warlock from './warlock';
import WaterSpirit from './water-spirit';
import Wolf from './wolf';

const monsters = {
  bat: Bat,
  'black orc': BlackOrc,
  cerberus: Cerberus,
  dragon: Dragon,
  'fire spirit': FireSpirit,
  'fungi bulb': FungiBulb,
  'gas cloud': GasCloud,
  goblin: Goblin,
  ghost: Ghost,
  imp: Imp,
  lich: Lich,
  'lich king': LichKing,
  medusa: Medusa,
  orc: Orc,
  plantera: Plantera,
  'poison cloud': PoisonCloud,
  'pumpkin ghost': PumpkinGhost,
  rat: Rat,
  salamander: Salamander,
  snake: Snake,
  'stone golem': StoneGolem,
  warlock: Warlock,
  'water spirit': WaterSpirit,
  wolf: Wolf,
};

export default monsters;
